Resta o fato, que felizmente, depois de tantas cacetadas, o eleitor está aprendendo cono jogam os políticos. BOM 2022!

@JimenezLandin @MetroCDMX @SSP_CDMX Buena maniobra para desarmarlo, pero falló la estrategia de someterlo y controlarlo.

De cualquier manera, bien por el personal; mal por la condición del frustrado suicida.

La tendencia del suicidio va en aumento; condiciones sociales y económicas pueden ser grave detonante.

